import React from 'react';
import {Box, ThemeProvider, Typography} from "@mui/material";
import {themeOptions} from "./theme";

function App() {
    return (
        <ThemeProvider theme={themeOptions}>
            <Box>
                <Box sx={{
                    position: "fixed"
                }}>
                    <Box sx={{
                        marginLeft: "74px",
                        marginTop: "50px"
                    }}>
                        <Typography variant={"h1"}>
                            JZ
                        </Typography>
                    </Box>
                </Box>

                <Box
                    sx={{
                        height: "800px",
                        backgroundColor: "#FFF5DC"
                    }}>

                </Box>
            </Box>

        </ThemeProvider>

    );
}

export default App;
